/* eslint-disable no-restricted-globals */
import React from 'react'
import { Outlet, Navigate } from "react-router-dom";


export default function privatelayout() {
    const user = false
    return (
        user ? <Outlet />
        : <Navigate to="/" state={{ from: location }} replace />
    );
}
